import time


def longest_substring(s):
    sb = []
    count = [0]
    if len(s) == 1:
        sb.append(s)
    for i in range(len(s)):
        sb.append(s[i])
        j = i + 1
        while j < len(s):
            if s[i] != s[j]:
                sb.append(s[i:j + 1])
            elif s[i] == s[j]:
                break
            j = j + 1

    for ss in sb:
        ct = 0
        subs = []
        if len(ss) == 1:
            count.append(len(ss))
        else:
            for i in range(len(ss)):
                if ss[i] not in subs:
                    subs.append(ss[i])
                    ct += 1
                else:
                    break
                count.append(ct)
    return max(count)
